    return (
        <section className="banner_usuario">
            <div className="row">
                <div className="col-12 col-md-6">
                    <AvatarUsuario/>
                </div>
                <div className="col-12 col-md-6 text-rigth">
                    <EstadisticasUsuario/>
                </div>
            </div>
        </section>
    );
}
 
export default BannerUsuario;
